import React from 'react';

function CpiFedCard() {
    return (
        <>
            <div className = 'card h-100'>
                <div className = "card-header">
                    CPI (物價通貨膨脹指數) vs FED (聯邦基金利率)
                </div>
            </div>
        </>
    );
}

export default CpiFedCard;
